import 'dart:convert';

import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';
import 'package:http/http.dart' as http;

class ViewDetail extends StatefulWidget {
  int userID;

  ViewDetail(this.userID);

  @override
  _ViewDetailState createState() => _ViewDetailState(userID);
}

class _ViewDetailState extends State<ViewDetail> {
  final num number;

  _ViewDetailState(this.number);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('검색 결과'),
      ),
      body: FutureBuilder(
        future: fetchString([number.toString()]),
        builder: (context, snapshot) {
          if (snapshot.hasError == true) {
            print('snapshot.hasError -> $snapshot.hasError');
            // 에러 메시지는 굳이 화면 가운데에 놓을 필요가 없다.
            return Text('${snapshot.error}');
          } else if (snapshot.connectionState == ConnectionState.done) {
            // 나머지 공간 전체를 사용하는데, 전체 공간을 사용하지 않는 위젯이라면 가운데에 배치.
            return _ScrollView(snapshot.data);
          }

          // 인디케이터가 다른 위젯들처럼 화면 가운데에 위치시킨다.
          return Center(
            child: CircularProgressIndicator(),
          );
        },
      ),
      // body: SingleChildScrollView(
      //   child: Column(
      //     mainAxisAlignment: MainAxisAlignment.start,
      //     children: [
      //       Container(
      //         child: Image.network(
      //           // "images/$medicineNum.jpg",
      //   'data:image/jpeg;base64,',
      //           height: MediaQuery.of(context).size.height * 0.3,
      //         ),
      //         alignment: Alignment.topCenter,
      //       ),
      //       Text(),
      //     ],
      //   ),
      // ),
    );
  }

  Widget _ScrollView(String data) {
    dynamic items = json.decode(data);

    return SingleChildScrollView(
      child: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.start,
          crossAxisAlignment: CrossAxisAlignment.start,
          children: [
            SizedBox(height: 20),
            Image.network(
              // "images/$medicineNum.jpg",
              'https://nedrug.mfds.go.kr/pbp/cmn/itemImageDownload/151853651029700142',
              height: MediaQuery.of(context).size.height * 0.3,
            ),
            SizedBox(height: 20),
            Text('First Name : ' + items['firstName']),
            Text('Last Name : ' + items['lastName']),
            Text('User Name : ' + items['username']),
            Text('email : ' + items['email']),
            Text('age : ' + items['age'].toString()),
          ],
        ),
      ),
    );
  }
}

Future<String> fetchString(List<String> query) async {
  // final details = ['', 'string', 'image', 'array'];
  // final urlPath = 'http://127.0.0.1:5000/' + details[kind.index];
  // 아래처럼 구하면 details 배열과 동기화시키지 않아도 된다.
  // 코드는 좀 복잡해지지만 업그레이드에서 유리할 수 있다.
  // DataKind.IMAGE 상수를 toString 함수에 전달하면 'DataKind.IMAGE'가 나온다.
  // final detail = kind.toString().split('.')[1].toLowerCase();
  String detail = query[0];
  dynamic urlPath = 'http://fakeapi.jsonparseronline.com/users/' + detail;

  dynamic response = await http.get(urlPath);

  if (response.statusCode == 200) {
    return response.body;
  } else {
    print('response code is not 200');
  }
  throw Exception('데이터 수신 실패!');
}
